import React from 'react';
import AppLayout from "../components/AppLayout"

import Head from "next/head"
function index(){

    return (
        <>
            <Head>
                <title>home</title>
            </Head>
            <AppLayout>
                <PostForm />
                <PostCard />
            </AppLayout>
        </>
    )
}

export default index;
